<html lang="en">
<head>
  <meta charset="UTF-8">

  <meta name="viewport" content="width=device-width, initial-scale=1.0">

  <link rel="icon" type="image/x-icon" href="assets/favicon.ico">
  <title>Secure Financial Portal</title>
  <script src="https://cdnjs.cloudflare.com/ajax/libs/crypto-js/4.1.1/crypto-js.min.js"></script>
  <style>
    body {
      background: #222; 
      color: #eee; 
      font-family: Arial, sans-serif; 
      margin: 0; 
      padding: 0;
    }
    #loginSection {
      text-align: center;
      padding: 30px;
    }
    #loginSection form {
      display: inline-block;
      margin-top: 20px;
    }
    #loginSection input[type="password"] {
      padding: 10px;
      font-size: 16px;
      width: 220px;
    }
    #loginSection button {
      padding: 10px 20px;
      font-size: 16px;
      margin-top: 10px;
    }
    #loginSection label {
      font-size: 14px;
      margin-left: 5px;
    }
    #errorMsg {
      color: red;
      margin-top: 10px;
    }
    #mainContent {
      display: none;
      padding: 20px;
    }
  </style>
</head>
<body>
  <div id="loginSection">
    <h2>Please Log In to Access Your Portal</h2>
    <form id="loginForm" onsubmit="event.preventDefault(); decryptAndLoad();">
      <input type="password" id="loginPassword" name="loginPassword" placeholder="Enter your password" autocomplete="current-password">
      <br>
      <input type="checkbox" id="rememberCheckbox" name="rememberCheckbox">
      <label for="rememberCheckbox">Remember my password</label>
      <br>
      <button type="submit">Login</button>
    </form>
    <p id="errorMsg"></p>
  </div>
  <div id="mainContent">
  </div>
